function tagCloud(){tagcloud({selector:"#sidebarPage .cloud",fontsize:16,radius:65,mspeed:"normal",ispeed:"normal",direction:135,keep:!1})}function getCookie(n){return 0<document.cookie.length&&(c_start=document.cookie.indexOf(n+"="),-1!=c_start)&&(c_start=c_start+n.length+1,c_end=document.cookie.indexOf(";",c_start),-1==c_end&&(c_end=document.cookie.length),unescape(document.cookie.substring(c_start,c_end)))}function goLogin(n,t){n.$confirm(t,"提示",{confirmButtonText:"去登录",cancelButtonText:"暂不登录",type:"warning"}).then(function(){window.location.href="/login"}).catch(function(){})}